import React, { useState } from 'react';

function CounterExample() {
    const [count, seCount] = useState(0)

    return (
        <div>
            <h1> {count}</h1>
            <h1 onClick={()=>seCount(count+1)}></h1>
        </div>
    );
}

export default CounterExample;
